import React, {useState,useEffect} from 'react';
import './css/WelcomeBack.css';
const WelcomeBack = () =>{
  return(
    <React.Fragment>
    <figure>
      <h4>Welcome back!</h4>
      <p>It's time to get started! View new opportunities now, or continue on your previous work.</p>
      <img src="https://themes.startbootstrap.com/sb-admin-pro/assets/img/freepik/at-work-pana.svg" alt="girl"/>
    </figure>
    </React.Fragment>
  )
}
export default WelcomeBack;
